import styled from 'styled-components';
import { Link } from 'react-router-dom';

export const ShowProfileButton = styled.button`
  height: 30px;
  width: 120px;
  border-radius: 3px;
  background: #162447;
  color: #fff;
`;

export const CustomLink = styled(Link)`npm i @types/react-router-dom
  color: #fff;
`;
